export class MenuComponent {
  inputValue: string = "Motorola";
  itens: Itens[];

  constructor(private apiML : ApiMercadoLivreService){}

  getItens(): void {
    this.apiML.getItens(this.inputValue).subscribe(
      (result) => {
        this.itens = result;
      },
      (error) => {
        console.log(error);
      }
    );
  }
}
